        super(props);
        this.state = {
          components: "main"
        }
      }

      router = (route) => {
        this.setState({components: route});
      }

    render() {
      const hompage = <HomePage />;
      const header = <Header />;
      const maps = <Maps />;

      switch (this.state.components){
        case "main":
          return(<React.Fragment>{header}{hompage}</React.Fragment>);
          break;
